import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';

function BookNow({ user }) {
  const { movieId } = useParams(); // Get the movie ID from the URL
  const [movie, setMovie] = useState(null);
  const [cinemas, setCinemas] = useState([]);
  const [selectedCinema, setSelectedCinema] = useState(null);
  const [selectedShowtime, setSelectedShowtime] = useState(null);

  useEffect(() => {
    // Fetch movie details using the movieId
    fetch(`http://localhost:5001/movies/${movieId}`)
      .then((response) => response.json())
      .then((data) => setMovie(data))
      .catch((error) => console.error('Error fetching movie:', error));
  }, [movieId]);

  useEffect(() => {
    // Fetch all cinemas along with their showtimes
    fetch('http://localhost:5001/cinemas')
      .then((response) => response.json())
      .then((data) => setCinemas(data))
      .catch((error) => console.error('Error fetching cinemas:', error));
  }, []);

  const handleCinemaSelect = (cinemaId) => {
    setSelectedCinema(cinemaId);
    setSelectedShowtime(null); // Reset showtime selection
  };

  const handleShowtimeSelect = (showtime) => {
    setSelectedShowtime(showtime);
  };

  if (!movie) {
    return <p>Loading movie details...</p>;
  }

  return (
    <div className="book-now-page">
      <h1>Welcome to the Book Now page!</h1>
      {user ? <h3>Hi, {user.name}!</h3> : <p>Please log in to book a movie.</p>}
      <p>You are booking tickets for <strong>{movie.movie_name}</strong></p>

      <div className="cinemas-list">
        <h3>Select a Cinema</h3>
        {cinemas.length === 0 ? (
          <p>Loading cinemas...</p>
        ) : (
          <ul>
            {cinemas.map((cinema) => (
              <li key={cinema._id}>
                <button
                  onClick={() => handleCinemaSelect(cinema._id)}
                  className={selectedCinema === cinema._id ? 'selected' : ''}
                >
                  {cinema.cinema_name}
                </button>
                {selectedCinema === cinema._id && (
                  <div className="showtimes">
                    <h4>Showtimes:</h4>
                    {cinema.showtimes.map((showtime, index) => (
                      <button
                        key={index}
                        onClick={() => handleShowtimeSelect(showtime)}
                        className={selectedShowtime === showtime ? 'selected' : ''}
                      >
                        {showtime.showtime} on {new Date(showtime.date).toLocaleString()}
                      </button>
                    ))}
                  </div>
                )}
              </li>
            ))}
          </ul>
        )}
      </div>

      {selectedShowtime && selectedCinema && (
        <div className="booking-summary">
          <h3>Booking Summary:</h3>
          <p>Cinema: {cinemas.find((cinema) => cinema._id === selectedCinema)?.cinema_name}</p>
          <p>Showtime: {selectedShowtime.showtime} on {new Date(selectedShowtime.date).toLocaleString()}</p>
          <button>Confirm Booking</button>
        </div>
      )}
    </div>
  );
}

export default BookNow;
